(7, 'Javed Ali', '1982-07-05', 'Javed Ali is an Indian playback singer who predominantly sings in Hindi. He has also sung in various regional languages like Bengali, Kannada, Malayalam, Gujarati, Marathi, Odia, Tamil, Telugu and Urdu.'),
(8, 'Alka Yagnik', '1966-03-20', 'Alka Yagnik is an Indian playback singer who works predominantly in Hindi Cinema. She has been described in the media as one of the most prominent and successful playback singers in Bollywood.'),
(9, 'Udit Narayan', '1955-12-01', 'Udit Narayan is an Indian playback singer whose songs have been featured mainly in Bollywood movies of Hindi language. He has also sung in various other languages including Telugu, Kannada, Tamil, Bengali, Odia, Bhojpuri, Nepali, Malayalam, Assamese and Maithili.'),
